  render: () => {
    const [phone, setPhone] = useState('');
    const asYouFormat = (phoneString: string) => {
      // partial parsePhoneNumber always return country code :(
      const asYouType = new AsYouType('US');
      return asYouType.input(phoneString);
    };
    const formatPhoneOnBlur = () => {
      setPhone(asYouFormat(phone));
    };
    const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
      setPhone(event.target.value);
    };
    return <Grid container rowSpacing={3} columnSpacing={2} sx={{
      maxWidth: '360px'
    }}>
        <Grid size="grow">
          <TextField type="tel" label="Phone" id="phone" value={phone} onBlur={formatPhoneOnBlur} onChange={handleChange} fullWidth={true} />
        </Grid>
        <Grid size={{
        xs: 2
      }} sx={{
        minWidth: '5rem'
      }}>
          <TextField type="tel" label="Ext" id="phoneextension" fullWidth={true} />
        </Grid>
      </Grid>;
  }
